import { Provider } from 'react-redux';

import {Link} from 'react-router-dom';
import './App.scss';
const store = configureStore()

function App() {
  return (
    <>
      <Provider store={store}>
        <Header/>
        <BrowserRouter>
          <Routes>
            <Route index element={<Home />} />
            <Route path='home' element={<Home/>}/>
          </Routes>
        </BrowserRouter>
      </Provider>
    </>
  );
}

export default App;
